import React, { Component } from "react";

class Counter extends React.Component {
  state = {
    count: 12,
  };
  render() {
    return (
      <React.Fragment>
        <h1>Amazon</h1>
        <span>{this.state.count}</span>
        <button>Add to Cart</button>
      </React.Fragment>
    );
  }
}

export default Counter;
